sys_variable_value.value:
(function execute(inputs, outputs) {
  var daysOfWeek = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Sunday']
  var months = ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'Septemper', 'October', 'November', 'December'];

  var date = inputs.date
  var gdt = new GlideDateTime(date.toString());
  outputs.month = months[gdt.getMonthUTC()];
  outputs.dayofweek = daysOfWeek[gdt.getDayOfWeekUTC()-1];
  outputs.year = gdt.getYearUTC();
  outputs.day = gdt.getDayOfMonthUTC()
})(inputs, outputs);

